#define APP_TIMER_PRESCALER      0    /**< Value of the RTC1 PRESCALER register. */
#define APP_TIMER_OP_QUEUE_SIZE  2                      /**< Size of timer operation queues. */

#define BUTTON_DEBOUNCE_DELAY           50 // Delay from a GPIOTE event until a button is reported as pushed. 
#define APP_GPIOTE_MAX_USERS            1  // Maximum number of users of the GPIOTE handler. 

#define    RED  0x0000FF
#define  GREEN  0x00FF00
#define   BLUE  0xFF0000
#define  WHITE  0xFFFFFF
#define  BLACK  0x000000

#define BUTTON_NONE 0
#define BUTTON_UP   1
#define BUTTON_DOWN 2

static const unsigned long color_sequence[] = {
    5,
    RED,
    GREEN,
    BLUE,
    WHITE,
    BLACK
};

static volatile bool button_state_change = false;
static volatile uint8_t button_state = BUTTON_NONE;
static volatile uint8_t color_index = 0;

static void increment_color() {
    if (color_index == color_sequence[0]) {
        color_index = 0;
    }
    else {
        color_index++;
    }
}

static void decrement_color() {
    if (color_index != 0) {
        color_index--;
    }
    else {
        color_index = color_sequence[0];
    }
}

